import React, { useEffect, useState } from "react";
import CandlestickChart from "./CandlestickChart";
import "./StockScanner.css";

const StockScanner = ({ onTickersChange }) => {
  const [stocks, setStocks] = useState([]); // Initialize stocks as an empty array
  const [minPrice, setMinPrice] = useState("");
  const [maxPrice, setMaxPrice] = useState("");
  const [minRSI, setMinRSI] = useState(30); // Default RSI range
  const [maxRSI, setMaxRSI] = useState(70);
  const [volumeSurge, setVolumeSurge] = useState(1.2); // Default volume surge
  const [error, setError] = useState("");

  // Function to fetch stocks based on search criteria
  const fetchStocks = async () => {
    try {
      // Construct query parameters
      const queryParams = new URLSearchParams({
        min_price: minPrice || "0",
        max_price: maxPrice || "1000000",
        min_rsi: minRSI || "0",
        max_rsi: maxRSI || "100",
        volume_surge: volumeSurge || "1",
      });

      const response = await fetch(
        `http://localhost:5000/api/scan-stocks?${queryParams.toString()}`
      );

      if (!response.ok) {
        throw new Error("Failed to fetch stocks.");
      }

      const data = await response.json();

      // Handle the fetched stock data
      if (data.candidates && data.candidates.length > 0) {
        setStocks(data.candidates); // Update stocks
        setError(""); // Clear previous errors

        // Update tickers for the parent component
        const tickers = data.candidates.map((stock) => stock.T);
        onTickersChange(tickers);
      } else {
        setStocks([]); // No stocks returned
        setError("No stocks found. Please adjust your criteria.");
        onTickersChange([]); // Clear tickers in parent
      }
    } catch (err) {
      console.error("Error fetching stocks:", err);
      setError("Failed to fetch stocks.");
      setStocks([]); // Clear stocks on error
      onTickersChange([]); // Clear tickers in parent
    }
  };

  return (
    <div className="stock-scanner">
      <h2 style={{ textAlign: "center" }}>Find Stocks by Custom Criteria</h2>

      {/* Filter Criteria Form */}
      <div className="filter-criteria">
        <label>
          Min Price:
          <input
            type="number"
            value={minPrice}
            onChange={(e) => setMinPrice(e.target.value)}
            placeholder="Enter min price"
          />
        </label>
        <label>
          Max Price:
          <input
            type="number"
            value={maxPrice}
            onChange={(e) => setMaxPrice(e.target.value)}
            placeholder="Enter max price"
          />
        </label>
        <label>
          Min RSI:
          <input
            type="number"
            value={minRSI}
            onChange={(e) => setMinRSI(e.target.value)}
            placeholder="Enter min RSI"
          />
        </label>
        <label>
          Max RSI:
          <input
            type="number"
            value={maxRSI}
            onChange={(e) => setMaxRSI(e.target.value)}
            placeholder="Enter max RSI"
          />
        </label>
        <label>
          Volume Surge:
          <input
            type="number"
            step="0.1"
            value={volumeSurge}
            onChange={(e) => setVolumeSurge(e.target.value)}
            placeholder="Enter volume surge"
          />
        </label>
        <button onClick={fetchStocks}>Search Stocks</button>
      </div>

      {/* Display Error Message */}
      {error && <p style={{ color: "red", textAlign: "center" }}>{error}</p>}

      {/* Display Stock Results */}
      <div className="stock-list">
        {stocks && stocks.length > 0 ? (
          stocks.map((stock) => (
            <div className="stock-card" key={stock.T}>
              <CandlestickChart
                ticker={stock.T} // Pass ticker symbol
                entryPoint={stock.c * 0.95} // Entry point is 5% below close
                exitPoint={stock.c * 1.1} // Exit point is 10% above close
                additionalData={{
                  volatility: `${(stock.volatility * 100).toFixed(2)}%`,
                  change: `${(stock.price_change * 100).toFixed(2)}%`,
                  rsi: stock.rsi || "N/A",
                }} // Pass additional data
              />
            </div>
          ))
        ) : (
          <p style={{ textAlign: "center" }}>No stocks found. Please adjust your criteria.</p>
        )}
      </div>
    </div>
  );
};

export default StockScanner;
